import {
  Box,
  Container,
  Text,
  Center,
  VStack,
  Input,
  Flex,
} from "@chakra-ui/react";

export const Login = () => {
  return (
    <Flex width="100vw" height="100vh" bgColor="#121214" direction="column">
      <Text color="#FF577F">Kenzie Hub</Text>
      <VStack>
        <Input />
      </VStack>
    </Flex>
  );
};
